import React from 'react';
import { Link, NavLink } from 'react-router-dom'
import '../css/navbar.css';

const Navbar = () =>
{
    return(
        <nav className="background">
            <Link className="navbar-brand nav-brand" to="/">iCinema</Link>

            {/* <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"/>
            </button> */}

            <ul className="navbar-nav navbar-items">
                <li> <NavLink to="/movies">Movies <span className="sr-only">(current)</span></NavLink></li>
                <li> <NavLink to="/customers">Customers</NavLink> </li>
                <li> <NavLink to="/rentals">Rentals</NavLink> </li>

                <li> <NavLink className="nav-link" to="/login">Login</NavLink>
                </li>

                <li>
                    <NavLink className="nav-link" to="/resigter">Register</NavLink>
                </li>
            </ul>
        </nav>
    )
}

export default Navbar;
